HttpHeaders heading = new DefaultHttpHeaders();
heading.set(HttpHeaderNames.CONNECTION, HttpHeaderValues.KEEP_ALIVE);
heading.set(HttpHeaderNames.SERVER, appConstants.get(ServerConfig.SERVER_NAME));

/* 
 * This is a bug in the authors code. It causes a bug in the Netty library
 * if the httpQuery.headers() are not read only, they are immediately written to and
 * cause a null pointer exception in AbstractHttp2ConnectionHandler.
 * 
 * https://github.com/netty/netty/blob/4.1/codec-http2/src/main/java/io/netty/handler/codec/http2/AbstractHttp2ConnectionHandler.java#L865
 * 
 * if (responseHeaders == null) {
 *   throw new NullPointerException("responseHeaders");
 * }
 * 
 * We are here because the headers are not read only, and we get a NullPointerException.
 * 
 * To fix this, we must make sure that they are read only.
 * 
 * 
 */
Headings heading = new NetworkLibraryHeadingSupporteHeadings(httpQuery.headers());
//Headings heading = new DefaultHttpHeaders(true);

